import { Col, Row, Container } from 'reactstrap';
import Header from '../header';
import RandomChar from '../randomChar';
import ItemList from '../itemList';
import CharDetails from '../charDetails';
import styled from 'styled-components'
import './button.css'

// import gotServices from '../../Services'
const Button1 = styled.button`
background-color: #4CAF50;
border: none;
color: white;
padding: 15px 32px;
text-align: center;
text-decoration: none;
display: inline-block;
width: 180px;
padding-bottom:20px;
font-size: 50px;
`;
const Div1 = styled.div`
padding-bottom:20px
width:200px`

const Butick = () => {
    return (
        <>
            <Div1>
                <Button1>Hide</Button1>
            </Div1>
        </>
    )
}
const App = () => {
    const RandomChar1 = RandomChar


    return (
        <>
            <Container>
                <Header />
            </Container>
            <Container>

                <Row>
                    <Col lg={{ size: 5, offset: 0 }}>
                        <RandomChar1 />
                    </Col>
                </Row>
                <Butick />
                <Row>

                    <Col md='6'>
                        <ItemList />
                    </Col>
                    <Col md='6'>
                        <CharDetails />
                    </Col>
                </Row>
            </Container>
        </>
    );
};

export default App;
